import './Loagind.css'

function Loading() {
  return(
    <div id="centro">
			<div id="cont">
				<div id="circ1" className="circle"></div>
				<div id="quad1" className="quad"></div>
				<div id="quad2" className="quad"></div>
				<div id="quad3" className="quad"></div>
				<div id="quad4" className="quad"></div>
				<div id="quad5" className="quad"></div>
				<div id="quad6" className="quad"></div>
				<div id="quad7" className="quad"></div>
				<div id="quad8" className="quad"></div>
				<div id="quad9" className="quad"></div>
			</div>
			<div id="borda" ></div>
		</div>
  );
}

export default Loading;
